import math

def generate_prime_list(start_num, end_num):
    prime_list = []
    for num in range(start_num, end_num - 1):
        if num < 2:
            continue
        elif num == 2:
            prime_list.append(num)
        else:
            for i in range(2, int(math.sqrt(num)) + 1):
                if num % i == 0:
                    break
            else:
                prime_list.append(num)
    return prime_list

